drop table [case];

create table [RedisLabsCDC].[dbo].[case] (
    caseid BIGINT NOT NULL,
	status VARCHAR(13),
    priority VARCHAR(4),
	investigator INT,
	value INT,
	date_reported BIGINT,
	date_last_updated BIGINT,
	files VARCHAR(50),
	report_body VARCHAR(50),
	primary_acctno VARCHAR(50),
	ssn VARCHAR(50),
	ip VARCHAR(50),
	phone VARCHAR(50),
	account_details VARCHAR(50),
	related_tags VARCHAR(50),
    PRIMARY KEY ([caseid])
);

-- Enable case table for CDC
EXEC sys.sp_cdc_enable_table @source_schema = 'dbo'
       , @source_name = 'case'
       , @role_name = NULL
       , @capture_instance = 'cdcauditing_case'

USE RedisLabsCDC;
EXEC sys.sp_cdc_help_change_data_capture;


